 systemet udsender automatiske emails, som f.eks. efter registrering eller ved salgsnotificeringer<\\/li><li><strong>email notificeringer<\\/strong> \\u2013 Du kan konfigurere hvilke slags notificeringer som du \\u00f8nsker at modtage som annonc\\u00f8r, og hvilke notificeringer der vil v\\u00e6re mulige for affiliates.<\\/li><\\/ul>S\\u00f8rg for at mail konto er indstillet korrekt \\u2013 pr\\u00f8v at teste mailudsending. Hvis det ikke virker vil affiliates ikke modtage bekr\\u00e6ftelsesmails efter registrering, osv.\"],[\"Customize your affiliate signup form\",\"Tilpas din affiliate registreringsform\"],[\"GetStartedSignupForm\",\"Tjek standard registreringsformen og tilpas den, hvis du \\u00f8nsker det.<br\\/><br\\/>\\r\\nRegistreringsformen kommer med et informations mini-site som indeholder informationer om affiliate programmet osv.<br\\/>Du kan bruge mini-sitet, eller slette det og kun bruge registreringsformen.\"],[\"Customize affiliate panel\",\"Tilpas affiliate panel\"],[\"GetStartedAffPanel\",\"Affiliate panelet i Post Affiliate Pro er meget sleksibelt.<br\\/>Du kan konfigurere hvordan menuen vil se ud, hvilket indhold du vil have, samt skrive dit eget indhold eller linke til en anden side.\"],[\"GetStartedIntegrate\",\"Integration er en m\\u00e5de til at sammenkoble affiliate systemet med dit nuv\\u00e6rende website, shopping kurv eller betalingsgateway p\\u00e5 en m\\u00e5de s\\u00e5 affiliate systemet vil blive underrettet om referenter og k\\u00f8b.<br\\/>\\r\\nN\\u00e5r underrettet s\\u00e5 registrerer affiliate systemet salget, finder den refererende affiliate (hvis der er nogen) og opretter de tilh\\u00f8rende kommisioner til ham\\/hende.<br\\/><br\\/>\\r\\nIntegration betyder normalt at du skal inds\\u00e6tte nogle f\\u00e5 linie kode p\\u00e5 dine sider, og det er beskrevet trin-efter-trin i Integrationsguiden for alle de mest kendte webshopsystemer og betalingssystemer.\"],[\"Test everything\",\"Test alt\"],[\"GetStartedTest\",\"N\\u00e5r du h